INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (10040, 0.0, "2030/12/17 14:59:59", 0.0, 1, 0.0, "2020/04/30 12:00:00", 24001, "リン", 0, 1, "あたしだって\nやるときはやるよ！", 24, 102601);
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (10040, 0.0, "2030/12/17 14:59:59", 0.0, 1, 0.0, "2020/04/30 12:00:00", 24002, "リン", 1, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 24, 102601);
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (10040, 0.0, "2030/12/17 14:59:59", 0.0, 1, 0.0, "2020/04/30 12:00:00", 24003, "リン", 2, 1, "終わった終わった\n一人でもなんとか\nなるもんだね", 24, 102601);
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (10040, 0.0, "2030/12/17 14:59:59", 0.0, 2, 0.0, "2020/04/30 12:00:00", 24004, "リン", 3, 2, "やったね！\nこれでようやく\nサボれるよ…", 24, 102601);
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (10040, 0.0, "2030/12/17 14:59:59", 0.0, 1, 0.0, "2020/04/30 12:00:00", 24005, "リン", 4, 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 24, 102601);
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (10040, 0.0, "2030/12/17 14:59:59", 0.0, 2, 0.0, "2020/04/30 12:00:00", 24006, "リン", 5, 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 24, 102601);
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (10040, 0.0, "2030/12/17 14:59:59", 0.0, 2, 0.0, "2020/04/30 12:00:00", 24007, "リン", 6, 2, "あたしも意外と\nやるもんでしょ？", 24, 102601);
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (10040, 0.0, "2030/12/17 14:59:59", 0.0, 4, 0.0, "2020/04/30 12:00:00", 24008, "リン", 7, 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 24, 102601);
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (10040, 0.0, "2030/12/17 14:59:59", 0.0, 4, 0.0, "2020/04/30 12:00:00", 24009, "リン", 8, 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", 24, 102601);
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (10040, 0.0, "2030/12/17 14:59:59", 0.0, 4, 0.0, "2020/04/30 12:00:00", 24010, "リン", 9, 4, "まじめに\nやったんだけどな…\n悔しいな～", 24, 102601);
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (10040, 0.0, "2030/12/17 14:59:59", 0.0, 4, 0.0, "2020/04/30 12:00:00", 24011, "リン", 10, 4, "やられた…\nねずみって意外と\nてごわいね", 24, 102601);
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (10040, 0.0, "2030/12/17 14:59:59", 0.0, 4, 0.0, "2020/04/30 12:00:00", 24012, "リン", 11, 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", 24, 102601);
INSERT INTO `v1_799cf3c15a75d8c1e7ec2240451d1444484ade27453e869770a6c65cdaa03d6a` VALUES (10040, 0.0, "2030/12/17 14:59:59", 0.0, 1, 1.81, "2020/04/30 12:00:00", 24013, "リン", 12, 4, "疲れた…\nけど、次こそは\n守り抜くよ…", 24, 102601);
